INSERT INTO `v1_15ee2407612457c92709c6c323f30f3ac3d3ad7fb72a2e923a23605ca1f3cc76` VALUES ("スタンダードコレクション", "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！", 1, "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！", 1, 3);
INSERT INTO `v1_15ee2407612457c92709c6c323f30f3ac3d3ad7fb72a2e923a23605ca1f3cc76` VALUES ("プレミアムコレクション", "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", 2, "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", 1, 10);
INSERT INTO `v1_15ee2407612457c92709c6c323f30f3ac3d3ad7fb72a2e923a23605ca1f3cc76` VALUES ("フェスコレクション", "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！", 3, "1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！", 1, 3);
